  false,\n\t\"url\": null,\n\t\"notes\": \"As the leading ocean agency, and as per
  the Guidelines for Research, Exploration and Salvage of RMS Titanic, issued under
  the authority of the RMS Titanic Maritime Act of 1986, the National Oceanic and
  Atmospheric Agency (NOAA) has a vested interest in the appropriate treatment and
  preservation of the Titanic wreck site.  NOAA supports continual scientific research
  of the wreck for the sake of advancing knowledge of in situ preservation and degradation
  rate.  Throughout its endeavors with Titanic, NOAA intends to promote full participation
  with other federal agencies, and academic and research institutions with respect
  to exploration and research of the wreck site. An eleven-day cruise to the Titanic
  wreck site will be conducted aboard the Russian science vessel R/V Akademik Mstislav
  Keldysh in conjunction with Deep Ocean Expeditions (DOE).   A majority of the cruise
  time will be allocated to Jim Cameron?s staff for filming purposes.  However, NOAA
  Office of Ocean Exploration (OE) has acquired two days of operation time with use
  of the vessel?s MIR submersibles.\",\n\t\"license_title\": null,\n\t\"extras\":
